import React from 'react'
import Card from './Card'
const events={
    name:'Jhon',
    location:'Jbeil',
    id:'1',
    image:''
}

function Events() {
  return (
    <div>
    
    <Card name={events.name} image={events.image} />

    </div>
  )
}

export default Events
